import React, { useState } from 'react';

const Navigation = () => {
  const [isNavOpen, setIsNavOpen] = useState(false);

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light bg-transparent" id="gtco-main-nav">
      <div className="container">
        <a className="navbar-brand" href="/">Diametrics Engineering Ltd</a>
        <button 
          className={`navbar-toggler ${isNavOpen ? 'change' : ''}`} 
          data-target="#my-nav" 
          onClick={toggleNav} 
          data-toggle="collapse"
        >
          <span className="bar1"></span>
          <span className="bar2"></span>
          <span className="bar3"></span>
        </button>
        <div id="my-nav" className={`collapse navbar-collapse ${isNavOpen ? 'show' : ''}`}>
          <ul className="navbar-nav mr-auto">
            <li className="nav-item">
              <a className="nav-link" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#services">Services</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#about">About</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#news">News</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#contact">Contact</a>
            </li>
          </ul>
          <form className="form-inline my-2 my-lg-0">
            <a href="#" className="btn btn-outline-dark my-2 my-sm-0 mr-3 text-uppercase">login</a>
            <a href="#" className="btn btn-info my-2 my-sm-0 text-uppercase">sign up</a>
          </form>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
